INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 100101, 450, "ひより", 200, 100101, 7, 100101, 100101, 0, "ヒヨリ", 0, 1, 0, 0, 1, 2.295, "【物理】前衛で、敵前線を押し返す笑顔の元気娘。\n前衛に対して大ダメージを与えるユニオンバーストと、\n自身の攻撃力を強化するスキルを持つ攻撃役。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 7, 100201, 450, "ゆい", 800, 100201, 7, 100201, 100201, 0, "ユイ", 0, 7, 0, 0, 2, 2.27, "【魔法】最後衛から、味方の回復と補助を行う魔法士。\n打たれ弱いが高い魔法攻撃力を持ち、ランクを上げると\n攻撃も補助もバランスよくこなせるようになる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 4, 100301, 450, "れい", 250, 100301, 7, 100301, 100301, 0, "レイ", 0, 4, 0, 0, 1, 1.965, "【物理】前衛で、一点突破で敵を討つ、孤高の剣士。\nユニオンバースト、スキル共に眼前の敵を倒す事に優れ、\n攻撃スキルやカウンターを駆使して前線を押し上げる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 100401, 450, "みそぎ", 205, 100401, 13, 100401, 100401, 0, "ミソギ", 0, 1, 0, 0, 1, 2.17, "【物理】最前衛で、敵の物理攻撃を邪魔するいたずら娘。\n目の前の敵を暗闇状態にし、命中率を大幅に下げるほか、\n敵一体の物理攻撃力を下げるスキルを持つ。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 2, 100501, 450, "まつり", 185, 100501, 2, 100501, 100501, 0, "マツリ", 0, 2, 0, 0, 1, 2.125, "【物理】前衛の、機敏な動きで敵をかき回す騎士見習い。\nユニオンバーストで相手の陣地の真ん中に飛び込み、\n自分の周囲を攻撃するスキルで相手を攻め立てる。", "2018/09/18 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 6, 100601, 450, "あかり", 570, 100601, 14, 100601, 100601, 0, "アカリ", 0, 6, 0, 0, 2, 2.19, "【魔法】中衛で、魔法パーティの強化を担う、双子の妹。\n敵の魔法防御力を大幅に下げるスキルや、魔法攻撃力を\n上昇させ、回復効果を付与するユニオンバーストを使う。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 3, 100701, 450, "みやこ", 125, 100701, 14, 100701, 100701, 0, "ミヤコ", 0, 3, 0, 0, 1, 1.7, "【物理】最前衛で、ひたすら敵の攻撃を避ける幽霊少女。\nスキルで幽霊に変身することで敵の攻撃を躱し、\nユニオンバーストでは敵をプリンにして食べてしまう。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 21, 100801, 450, "ゆき", 805, 100801, 12, 100801, 100801, 0, "ユキ", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛で物理パーティを補助する、歩く芸術作品。\n味方のユニオンバースト発動を早めるスキルのほか、\n暗闇状態にするスキルで敵の物理攻撃を封じる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 100901, 450, "あんな", 440, 100901, 11, 100901, 100901, 0, "アンナ", 0, 5, 0, 0, 2, 2.25, "【魔法】中衛から圧倒的な魔力で攻撃する、疾風の冥姫。\nユニオンバーストで敵全体に大ダメージを与えるが、\n高すぎる魔力の為、自分自身にも相応のリスクが生じる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 101001, 450, "まほ", 795, 101001, 4, 101001, 101001, 0, "マホ", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で味方のサポートを担当するメルヘン少女。\n味方全体を強化してＴＰを回復するユニオンバーストや、\nＨＰ回復、敵を暗闇にするスキルで戦況を好転させる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 8, 101101, 450, "りの", 700, 101101, 6, 101101, 101101, 0, "リノ", 0, 8, 0, 0, 1, 1.97, "【物理】後衛から、矢の雨を降らせる妹系アーチャー。\nクリティカル率を高める重ね掛け可能なスキルを持ち、\nダメージ回数の多いユニオンバーストをより強力にする。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 101201, 450, "はつね", 755, 101201, 9, 101201, 101201, 0, "ハツネ", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛の、対物理パーティが得意な超能力ガール。\nスキルが物理攻撃の敵に対して真価を発揮するため、\n物理攻撃型の敵パーティを一網打尽にする。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 7, 101301, 450, "ななか", 740, 101301, 9, 101301, 101301, 0, "ナナカ", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛から多彩な魔法を放つ、オタク魔法少女。\n体力が一番多い相手を狙うユニオンバーストやスキルは、\n敵のＨＰ状況により攻撃対象が変わる高威力の魔法攻撃。", "2018/11/19 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 101401, 450, "かすみ", 730, 101401, 9, 101401, 101401, 0, "カスミ", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で、相手の行動妨害に特化した名探偵。\n束縛や混乱を付与するスキルで相手の行動を妨害し、\n魔法防御力ダウンのフィールドを展開して王手をかける。", "2019/02/28 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 9, 101501, 450, "みさと", 735, 101501, 9, 101501, 101501, 0, "ミサト", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で魔法キャラを支援する、みんなの先生。\nユニオンバーストのＨＰ回復＆魔防アップ、先頭キャラの\n継続ＨＰ回復スキルは、味方の耐久力を大幅に高める。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 8, 101601, 450, "すずな", 705, 101601, 15, 101601, 101601, 0, "スズナ", 0, 8, 0, 0, 1, 1.97, "【物理】後衛からクリティカル攻撃するカリスマモデル。\nダメージ2倍のクリティカルダメージは\nスキルによる攻撃力アップでさらに破壊力を増す。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 1, 101701, 450, "かおり", 145, 101701, 4, 101701, 101701, 0, "カオリ", 0, 1, 0, 0, 1, 2.17, "【物理】最前衛で、累積スキルでダメージを稼ぐ南国娘。\nスキル「精神統一」を発動すると、カオリが攻撃する度に\n敵に効果が累積し、次のダメージがどんどん増えていく。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 101801, 450, "いお", 715, 101801, 15, 101801, 101801, 0, "イオ", 0, 5, 0, 0, 2, 2.6, "【魔法】後衛で、敵全体を誘惑するセクシー先生。\n敵のＴＰを奪うスキルでユニオンバースト発動を遅らせ、\n誘惑のユニオンバーストを放ち、戦場を大混乱に陥れる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 5, 102001, 450, "みみ", 360, 102001, 13, 102001, 102001, 0, "ミミ", 0, 5, 0, 0, 1, 2.125, "【物理】中衛で、敵前衛を崩す、うさぎっこ。\nユニオンバーストは、最も近い敵に大ダメージを与えた後\n隣の敵にも攻撃するので、前衛を早期に攻め落とせる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 3, 102101, 450, "くるみ", 240, 102101, 3, 102101, 102101, 0, "クルミ", 0, 3, 0, 0, 1, 1.675, "【物理】前衛で、味方の守りに特化した、極度の照れ屋。\nスキルで自分の周囲の物理、魔法防御力を上げつつ、\n近くの敵をスタンさせて足止めする。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 6, 102201, 450, "より", 575, 102201, 14, 102201, 102201, 0, "ヨリ", 0, 6, 0, 0, 2, 2.19, "【魔法】中衛から、強力な魔法で攻め立てる、双子の姉。\n自身のＨＰと引き換えに魔法攻撃力を増幅し、\nユニオンバーストやスキルの威力を高めて攻撃する。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 3, 102301, 450, "あやね", 210, 102301, 3, 102301, 102301, 0, "アヤネ", 0, 3, 0, 0, 1, 1.425, "【物理】前衛で、戦場をかき乱す、くまっ子。\nユニオンバーストで、相手を思い切り吹き飛ばすと同時に\nスタンと大ダメージを与えることで敵陣形を大きく乱す。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 7, 102501, 450, "すずめ", 720, 102501, 3, 102501, 102501, 0, "スズメ", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で、回復と攻撃をこなすドジっ娘メイド。\n周りの味方のＨＰを回復しつつ物理攻撃力を高める\nスキルは、中衛・後衛の攻撃役と抜群の相性。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 6, 102601, 450, "りん", 550, 102601, 3, 102601, 102601, 0, "リン", 0, 6, 0, 0, 1, 2.34, "【物理】中衛で物理パーティを強化するものぐさ少女。\n味方の物理攻撃力をアップしつつ、味方の魔法防御を\n高めることで攻守ともにパーティをサポートする。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 3, 102701, 450, "えりこ", 230, 102701, 11, 102701, 102701, 0, "エリコ", 0, 3, 0, 0, 1, 1.425, "【物理】前衛で、毒スキルで敵を粉砕する、通称壊し屋。\n最高クラスの攻撃力を持ち、ユニオンバーストで敵に\nとどめの一撃を放つ毎に、その攻撃力はさらに上昇する。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 102801, 450, "されん", 430, 102801, 3, 102801, 102801, 0, "サレン", 0, 4, 0, 0, 1, 2.09, "【物理】中衛で一発逆転を狙う、みんなのサレンママ。\nＨＰが下がるほどダメージが上昇するユニオンバーストと\n味方のＴＰを回復するスキルで、一気に形勢を逆転する。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 102901, 450, "のぞみ", 160, 102901, 10, 102901, 102901, 0, "ノゾミ", 0, 4, 0, 0, 1, 1.965, "【物理】前衛で、皆の壁になって戦うアイドルのぞみん。\n彼女がステージに立てば、味方の物理攻撃力が\n大きくアップし、さらに敵の注意を一手に惹き付ける。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 103001, 450, "にのん", 415, 103001, 12, 103001, 103001, 0, "ニノン", 0, 5, 0, 0, 1, 2.25, "【物理】中衛で、強力な範囲攻撃を操る、忍術の使い手。\n範囲攻撃のスキルで敵を倒す事で、自分のＴＰを回復し、\n強力なユニオンバーストの発動頻度を上げる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 5, 103101, 450, "しのぶ", 365, 103101, 14, 103101, 103101, 0, "シノブ", 0, 5, 0, 0, 1, 2.25, "【物理】中衛で、父親のドクロを召喚して戦う霊能少女。\n召喚した父親は、自分とは別に攻撃を行ってくれるほか、\nダメージを代わりに受けてくれることもある。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 103201, 450, "あきの", 180, 103201, 8, 103201, 103201, 0, "アキノ", 0, 5, 0, 0, 1, 2.125, "【物理】前衛で大暴れして攻める、令嬢剣士。\n自分の周りに、味方を回復するフィールドを作り出し、\n自ら前線を支え導く姿も、名家を背負う者のあるべき姿。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 6, 103301, 450, "まひる", 395, 103301, 5, 103301, 103301, 0, "マヒル", 0, 6, 0, 0, 1, 2.34, "【物理】中衛で、相手の動きを乱す牧場主。\n敵前衛をノックバックさせることで、隊列を崩し、\n他のキャラが使う範囲攻撃の対象に敵を押し込む。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 5, 103401, 450, "ゆかり", 405, 103401, 8, 103401, 103401, 0, "ユカリ", 0, 5, 0, 0, 1, 2.4, "【物理】中衛から、バリアや回復で味方を守る元聖騎士。\n傷ついた味方のＨＰやＴＰを回復するスキルを操り、\n打ち合いで消耗した所を、ピンポイントでサポートする。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 103601, 450, "きょうか", 810, 103601, 0, 103601, 103601, 0, "キョウカ", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛から強力な魔法で攻撃するちびっこ優等生。\nスキルで魔法攻撃力を瞬間的に高めた後に放つ\nユニオンバーストは敵単体への威力抜群。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 103701, 450, "とも", 220, 103701, 2, 103701, 103701, 0, "トモ", 0, 4, 0, 0, 1, 1.965, "【物理】前衛で、素早い斬撃を仕掛け敵を屠る剣術少女。\nユニオンバーストで自分の攻撃力と行動速度を上昇させ、\nほか攻撃スキルの殲滅能力を極限まで高め敵を圧倒する。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 8, 103801, 450, "しおり", 710, 103801, 5, 103801, 103801, 0, "シオリ", 0, 8, 0, 0, 1, 1.97, "【物理】最後衛から高火力スキルを連発するスナイパー。\nダメージを与えつつ、ＴＰを回復するスキルを持ち、\n強力な一撃のユニオンバーストを、素早く発動する。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 8, 104001, 450, "あおい", 785, 104001, 9, 104001, 104001, 0, "アオイ", 0, 8, 0, 0, 1, 1.97, "【物理】最後衛から状態異常の矢を放つ、ぼっちの射手。\nダメージと共に付与する毒や麻痺の追加効果により、\n防御力の高い敵であっても、確実にＨＰを削りとる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 7, 104201, 450, "ちか", 790, 104201, 10, 104201, 104201, 0, "チカ", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛から、前衛の戦いをサポートする唱喚士。\nユニオンバーストで、味方の回復と敵への攻撃を行う\n精霊を最前線に唱喚する。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 104301, 450, "まこと", 165, 104301, 4, 104301, 104301, 0, "マコト", 0, 5, 0, 0, 1, 2.125, "【物理】前衛で、敵の防御力を削り取る、正義の獣人。\n敵の盾役の防御力を下げ、着実にダメージを与えることで\n早期に敵の守りを突破する。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 104401, 450, "いりや", 425, 104401, 12, 104401, 104401, 0, "イリヤ", 0, 3, 0, 0, 2, 1.425, "【魔法】中衛で命を削り攻撃する「夜を統べる者」。\n自身のＨＰと引き換えに放つスキルは高い殲滅力を誇り\n範囲攻撃における威力では他の追随を許さない。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 2, 104501, 450, "くうか", 130, 104501, 12, 104501, 104501, 0, "クウカ", 0, 2, 0, 0, 1, 2.375, "【物理】前衛で囮となり、攻撃を引き付ける暴走ドＭ娘。\nユニオンバーストにより、自身に魔法バリアを張り、\n敵の魔法攻撃を吸収してＨＰを回復する。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 2, 104601, 450, "たまき", 215, 104601, 8, 104601, 104601, 0, "タマキ", 0, 2, 0, 0, 1, 2.25, "【物理】前衛の、対魔法パーティが得意な気まぐれ猫娘。\n攻撃スキルは、「魔法攻撃力が一番高い敵」を狙い撃ち、\nダメージ、魔法攻撃力ダウン、ＴＰ吸収と畳み掛ける。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 104701, 450, "じゅん", 135, 104701, 2, 104701, 104701, 0, "ジュン", 0, 5, 0, 0, 1, 2.125, "【物理】最前衛で、完全防御スキルを操る騎士団長。\nユニオンバーストであらゆるダメージを吸収するバリアを\n展開できる。特に長期戦で圧倒的な防御性能を誇る。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 6, 104801, 450, "みふゆ", 420, 104801, 8, 104801, 104801, 0, "ミフユ", 0, 6, 0, 0, 1, 2.19, "【物理】中衛の、スタンと回復のスキルを持つ傭兵戦士。\n高い防御力と自己回復能力を併せ持つ事で、\n中衛の守りを堅固にし、パーティを底支えする。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 104901, 450, "しずる", 285, 104901, 6, 104901, 104901, 0, "シズル", 0, 5, 0, 0, 1, 2.375, "【物理】前衛で、物理攻撃から味方を守る、お姉ちゃん。\nスキルで物理無効バリアを展開し、味方全員を守るほか、\n自身はさらに物理吸収バリアを纏い、敵前衛を討つ。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 7, 105001, 450, "みさき", 760, 105001, 15, 105001, 105001, 0, "ミサキ", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛から、範囲攻撃を行う、レディ・ウィッチ。\n複数回の範囲攻撃を放つスキルや、目の前の敵全てを\n攻撃するユニオンバーストを持ち、範囲殲滅に特化する。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 5, 105101, 450, "みつき", 565, 105101, 11, 105101, 105101, 0, "ミツキ", 0, 5, 0, 0, 1, 2.25, "【物理】中衛で、敵弱体化フィールドを操る隻眼の悪魔。\nフィールドの持続時間は短いが、範囲内の敵の\n物理防御力を大幅に減らす効果を持つ。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 4, 105201, 450, "りま", 105, 105201, 5, 105201, 105201, 0, "リマ", 0, 4, 0, 0, 1, 2.215, "【物理】最前衛で味方を守る、恋する乙女。\nバトル開始後、しばらくしてから最前線まで\n突進してきて、敵の目の前に立ちはだかる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 105301, 450, "もにか", 410, 105301, 12, 105301, 105301, 0, "モニカ", 0, 4, 0, 0, 1, 2.24, "【物理】中衛で、味方の攻撃を鼓舞する、軍人娘。\n味方全体の物理、魔法攻撃力の大幅アップに加えて、\n攻撃速度もあげることで、戦闘の早期終結を実現する。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 2, 1, 105401, 450, "つむぎ", 195, 105401, 10, 105401, 105401, 0, "ツムギ", 0, 1, 0, 0, 1, 2.42, "【物理】前衛で、敵の妨害に特化したテーラーガール。\n敵を強制的に移動させる事で陣形を崩し、さらに\n移動速度・行動速度を低下させ相手の反撃を遅らせる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 48, 105501, 450, "あゆみ", 510, 105501, 12, 105501, 105501, 0, "アユミ", 0, 48, 0, 0, 1, 2.34, "【物理】中衛で、どたばたと敵をかく乱する、純情少女。\n敵をスタンさせるスキルのほか、ユニオンバーストでは\n暗闇と混乱を付与することで敵を邪魔することができる。", "2019/03/19 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 105601, 450, "るか", 158, 105601, 2, 105601, 105601, 0, "ルカ", 0, 4, 0, 0, 1, 1.965, "【物理】前衛で味方のため剣を振るう、いなせな姉御。\n相手へのカウンターも行う挑発や、敵の防御力を下げる\nユニオンバーストを持ち、攻防両面で実力を発揮する。", "2018/11/03 19:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 105701, 450, "じーた", 245, 105701, 4, 170101, 105701, 0, "ジータ", 0, 4, 0, 0, 1, 1.965, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 5, 105801, 450, "ぺこりーぬ", 155, 105801, 1, 105801, 105801, 0, "ペコリーヌ", 0, 5, 0, 0, 1, 2.25, "【物理】前衛にて、全力で仲間を護る、腹ペコ剣士。\n高いＨＰに加えて、自分自身でもＨＰ回復できるため\nギリギリまで味方の壁役を引き受ける。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 6, 105901, 450, "こっころ", 500, 105901, 1, 105901, 105901, 0, "コッコロ", 0, 6, 0, 0, 1, 2.34, "【物理】中衛で、補助と攻撃で皆を支える、導きの巫女。\nユニオンバーストは、味方全体の攻撃力アップに加えて\n自らも回復するため、継続的なサポートが可能となる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 7, 106001, 450, "きゃる", 750, 106001, 1, 106001, 106001, 0, "キャル", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛から、強力な全体攻撃を放つ、強気な猫娘。\nスキルで敵の物理、魔法両方の防御力を下げるため\n編成を選ばずにバトルを有利に進められる。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 2, 106101, 450, "むいみ", 162, 106101, 7, 106101, 106101, 1, "ムイミ", 0, 2, 0, 0, 1, 1.8, "【物理】前衛で、伝説の剣「天楼覇断剣」を振るう少女。\n小技を駆使する通常の戦闘スタイルから一転、ユニオン\nバースト後は「天楼覇断剣」を携え、敵を薙ぎ払う。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 8, 106301, 450, "ありさ", 625, 106301, 1, 106301, 106301, 0, "アリサ", 0, 8, 0, 0, 1, 1.97, "【物理】後衛の、長期戦に優れた、森の守護者見習い。\nＴＰ回復によるユニオンバーストの速攻が可能。さらに\n使用後はスキル効果が上昇するため高い殲滅力を誇る。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 106401, 450, "しぇふぃ", 368, 106401, 1, 106401, 106401, 0, "シェフィ", 0, 4, 0, 0, 1, 1.84, "【物理】中衛で氷雪を操り敵を凍滅する、氷竜の少女。\nユニオンバーストで獲得する【氷竜の印】を消費して、\nスキルの効果を増幅し、清廉な剣技で敵を切り伏せる。", "2021/02/15 23:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 106501, 450, "かや", 168, 106501, 17, 106501, 106501, 0, "カヤ", 0, 1, 0, 0, 1, 2.17, "【物理】前衛で、敵を殴り倒す喧嘩屋ドラゴン族。\nスキルで自身の物理攻撃力を高め、全身全霊を懸け放つ\n初弾のユニオンバーストは、超大な破壊力を誇る。", "2019/11/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 106601, 450, "いのり", 197, 106601, 17, 106601, 106601, 0, "イノリ", 0, 3, 0, 0, 1, 1.55, "【物理】前衛で範囲攻撃が得意な口達者のドラゴン娘。\nユニオンバーストで範囲内の敵をまとめて吹き飛ばし、\n陣形を乱したところで、敵を一気に焼き尽くす。", "2020/06/17 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 106701, 450, "ほまれ", 727, 106701, 17, 106701, 106701, 1, "ホマレ", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛から無窮の魔力で全てを支配する龍の首領。\n障壁となる敵を龍眼で捉え、多彩な補助系スキルで敵の\n魔法攻撃からの耐性を弱め、雷霆の一撃で灰燼に帰す。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 106801, 450, "らびりすた", 560, 106801, 6, 106801, 106801, 1, "ラビリスタ", 0, 4, 0, 0, 1, 1.55, "【物理】中衛で、万有を自在に創造する『迷宮女王』。\n七冠としての権能を解放するユニオンバーストで自身を\n極大に強化し比類ない攻撃能力で仇なす者を剿滅する。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 106901, 450, "かいざーいんさいと", 660, 106901, 1, 106901, 106901, 1, "カイザーインサイト", 0, 45, 0, 0, 1, 2.0, "【物理】後衛で、天の星を瞳に宿し、覇道を進む皇。\n権能を解放し敵全体のバリアと全ステータスアップ効果を\n解除し、耐久力ダウンと複数の広範囲攻撃で敵を滅する。", "2022/11/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 107001, 450, "ねねか", 660, 107001, 1, 107001, 107001, 1, "ネネカ", 0, 0, 0, 0, 2, 2.0, "【魔法】後衛で、分身生成し敵を圧倒する『変貌大妃』。\n分身はネネカ自身と同じスキルをくり出し敵を攻撃する。\nその攻撃密度と制圧力の高さは他の追随を許さない。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 10, 107101, 450, "くりすてぃーな", 290, 107101, 2, 107101, 107101, 1, "クリスティーナ", 0, 4, 0, 0, 1, 2.0, "【物理】前衛で、絶対的な制圧力を誇る『誓約女君』。\n攻防一体かつ超大な破壊力を誇るユニオンバーストと、\nその発動を加速するＴＰ上昇アップスキルを併せ持つ。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 107501, 450, "ぺこりーぬ", 235, 107501, 1, 107501, 107501, 1, "ペコリーヌ（サマー）", 0, 5, 0, 0, 1, 2.125, "【物理】前衛から強烈な範囲攻撃を放つ、渚のお姫様。\nかき氷を食べて物理攻撃力を一気に上昇させ、\nユニオンバーストを放つことで前方の敵を殲滅する。", "2024/06/21 12:00:00", 0, "2024/06/26 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 6, 107601, 450, "こっころ", 535, 107601, 1, 107601, 107601, 1, "コッコロ（サマー）", 0, 6, 0, 0, 1, 2.34, "【物理】中衛で、物理キャラの補助を行う癒しの巫女。\nＨＰが一番少ない味方単体への特大回復スキルを持ち、\n瀕死の味方ですら瞬時に治癒する。", "2020/06/19 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 107701, 450, "すずめ", 775, 107701, 3, 107701, 107701, 1, "スズメ（サマー）", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛の防衛能力に秀でた、夏のドジっ娘メイド。\n味方全体に防御力アップと継続ＨＰ回復をかけ、\nさらに壁になるゴーレムを呼んで、戦線を支える。", "2024/06/21 12:00:00", 0, "2024/06/26 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 107801, 450, "きゃる", 780, 107801, 1, 107801, 107801, 1, "キャル（サマー）", 0, 7, 0, 0, 2, 1.92, "【魔法】後衛から強力な単体攻撃を放つ真夏の猫娘。\nスキルで敵の魔法防御力を下げた上で、\n敵単体への魔法攻撃を繰り出し、大ダメージを与える。", "2024/06/21 12:00:00", 0, "2024/06/26 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 2, 107901, 450, "たまき", 225, 107901, 8, 107901, 107901, 1, "タマキ（サマー）", 0, 2, 0, 0, 1, 2.0, "【物理】前衛で連続攻撃を放つ、海辺の気まぐれ猫娘。\nランダムな相手への単体攻撃を計４度行う\nユニオンバーストは、対象がランダムだが威力は抜群。", "2024/06/21 12:00:00", 0, "2024/06/26 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 6, 108001, 450, "みふゆ", 495, 108001, 8, 108001, 108001, 1, "ミフユ（サマー）", 0, 6, 0, 0, 1, 2.19, "【物理】中衛で、攻撃と補助の両方をこなす海の傭兵。\nユニオンバーストの効果で味方全体の物理攻撃力を高め、\n物理攻撃パーティの能力アップに一役買う。", "2020/07/20 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 108101, 450, "しのぶ", 440, 108101, 0, 108101, 108101, 1, "シノブ（ハロウィン）", 0, 3, 0, 0, 1, 1.55, "【物理】中衛で、弱った敵を刈り取る幻夜の霊能少女。\n弱った敵単体に大ダメージを与えるユニオンバーストは\n対象を撃破時さらに敵全体に追加ダメージを与える。", "2024/10/24 12:00:00", 0, "2024/10/28 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 108201, 450, "みやこ", 590, 108201, 0, 108201, 108201, 1, "ミヤコ（ハロウィン）", 0, 1, 0, 0, 1, 2.42, "【物理】中衛から、敵陣の後方を狙い撃つ幽霊狼少女。\n前方の相手を無視して妨害スキルやユニオンバーストを\n敵後方に放ち、特に防御力が低いキャラの脅威になる。", "2020/09/23 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 108301, 450, "みさき", 815, 108301, 15, 108301, 108301, 1, "ミサキ（ハロウィン）", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛で、妨害スキルを操るオシャレ魔法少女。\n相手を誘惑状態にするスキルや、複数の状態異常を\n同時に付与するユニオンバーストで相手をかく乱する。", "2024/10/24 12:00:00", 0, "2024/10/28 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 108401, 450, "ちか", 770, 108401, 10, 108401, 108401, 1, "チカ（クリスマス）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で、精霊を唱喚して戦う雪華の歌姫。\nユニオンバーストで呼び出す精霊たちはＨＰやＴＰを\n回復する能力を持ち、不利な戦況をも一変させる。", "2024/12/22 12:00:00", 0, "2024/12/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 3, 108501, 450, "くるみ", 295, 108501, 15, 108501, 108501, 1, "クルミ（クリスマス）", 0, 3, 0, 0, 1, 1.55, "【物理】前衛から、ベルの音色で味方を守る小さな女優。\n攻撃を受けるまで周囲にいる味方の防御力を大きく高める\nスキルを持つ。活用できれば無類の耐久力を誇る。", "2020/11/24 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 108601, 450, "あやね", 190, 108601, 10, 108601, 108601, 1, "アヤネ（クリスマス）", 0, 3, 0, 0, 1, 1.425, "【物理】前衛で、敵をなぎ倒していく聖夜のくまっ子。\nユニオンバーストはＨＰを消費するが威力は絶大。\nスキルで物理攻撃力を上げ、さらにダメージアップ。", "2024/12/22 12:00:00", 0, "2024/12/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 108701, 450, "ひより", 170, 108701, 7, 108701, 108701, 1, "ヒヨリ（ニューイヤー）", 0, 1, 0, 0, 1, 2.17, "【物理】前衛で、物理火力を担う、振り袖姿の元気娘。\n物理攻撃キャラの攻撃力を上昇させるスキルを使う。\nさらに高い威力の単体ユニオンバーストの攻撃力は随一。", "2024/03/11 12:00:00", 0, "2024/03/18 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 108801, 450, "ゆい", 745, 108801, 7, 108801, 108801, 1, "ユイ（ニューイヤー）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛の、補助魔法に特化した、晴れ姿の癒し手。\n自身の攻撃力と引き換えに強力なバリアと継続回復状態を\n味方全体に付与する。絶大な防御能力は他を圧倒する。", "2024/03/11 12:00:00", 0, "2024/03/18 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 22, 108901, 450, "れい", 153, 108901, 7, 108901, 108901, 1, "レイ（ニューイヤー）", 0, 4, 0, 0, 1, 2.215, "【物理】前衛で、魔法攻撃から味方を守る、華麗な剣士。\nスキルで範囲内の味方に魔法無効バリアを展開し、\nさらにユニオンバーストで敵をスタンさせ攻撃を断つ。", "2020/12/22 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 3, 109001, 450, "えりこ", 187, 109001, 11, 109001, 109001, 1, "エリコ（バレンタイン）", 0, 3, 0, 0, 1, 1.9, "【物理】前衛で、ピンチをチャンスに変える愛の壊し屋。\nスキルはＨＰを消費し、自身の攻撃力を高める。また、\nユニオンバーストはＨＰが低いほど超絶威力を発揮する。", "2021/01/25 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 109101, 450, "しずる", 385, 109101, 7, 109101, 109101, 1, "シズル（バレンタイン）", 0, 5, 0, 0, 1, 2.125, "【物理】中衛で皆を助けるパティシエールのお姉ちゃん。\n複数のパラメータが同時に上昇するフィールドを展開し、\nさらに効果時間中はスキル効果が大幅に強化される。", "2024/01/22 12:00:00", 0, "2024/01/26 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 23, 109201, 450, "あん", 630, 109201, 6, 109201, 109201, 0, "アン", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で、英霊の召喚術を武器に戦うお姫様。\n味方に英霊の加護を付与するスキルによるサポーターと、\n高威力の魔法によるアタッカーの二つの役割を併せ持つ。", "2019/03/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 23, 109301, 450, "るぅ", 640, 109301, 9, 109301, 109301, 1, "ルゥ", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で、オメメちゃんと戦う、ノーテンキ少女。\nスキルで呼び出すオメメちゃんは敵の攻撃を防ぐほか、\nその数が多いほどユニオンバーストの威力を増加させる。", "2021/03/23 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 109401, 450, "ぐれあ", 525, 109401, 9, 109401, 109401, 0, "グレア", 0, 1, 0, 0, 2, 2.27, "【魔法】中衛で、炎を操り敵を薙ぎ払う、竜人の少女。\n高い魔法攻撃力を生かした範囲攻撃を得意とする。\nまた、飛行能力を駆使して放つ突進攻撃も強力。", "2019/04/19 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 2, 109501, 450, "くうか", 140, 109501, 12, 109501, 109501, 0, "クウカ（オーエド）", 0, 7, 0, 0, 2, 2.066, "【魔法】最前衛で、味方を鼓舞する着物姿のドＭ娘。\n味方の魔法攻撃力を高め、敵の魔法防御力を下げる事で、\n魔法パーティのサポート兼防御役として活躍する。", "2019/04/30 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 2, 109601, 450, "にのん", 175, 109601, 12, 109601, 109601, 0, "ニノン（オーエド）", 0, 2, 0, 0, 1, 2.0, "【物理】最前衛で、忍法を駆使して敵と戦うクノイチ。\nユニオンバーストはクリティカル時のダメージを１．５倍\nにする特性を持ち、うまくかみ合った時の威力は抜群。", "2019/05/17 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 24, 109701, 450, "れむ", 540, 109701, 9, 109701, 109701, 1, "レム", 0, 13, 0, 0, 1, 2.25, "【物理】中衛で、鬼の力で敵を粉砕する、双子の妹。\n回復スキルの他にも、温度を操るスキルを得意とし、\n敵を凍結させた上でユニオンバーストで薙ぎ払う。", "2024/09/15 15:00:00", 0, "2024/09/25 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 1, 24, 109801, 450, "らむ", 545, 109801, 9, 109801, 109801, 1, "ラム", 0, 7, 0, 0, 2, 2.5, "【魔法】中衛で、特殊能力で味方を補助する、双子の姉。\n相手の物理攻撃を見切って回避させる「千里眼」や、\n敵全体を束縛するユニオンバーストの補助は効果絶大。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 23, 109901, 450, "えみりあ", 725, 109901, 9, 109901, 109901, 1, "エミリア", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で、攻撃と回復をこなす、ハーフエルフ。\n高い魔力で攻撃魔法を繰り出して敵を蹴散らしつつ、\nユニオンバーストは瀕死の味方すらも瞬時に癒す。", "2024/09/15 15:00:00", 0, "2024/09/25 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 8, 110001, 450, "すずな", 705, 110001, 15, 110001, 110001, 1, "スズナ（サマー）", 0, 8, 0, 0, 1, 1.82, "【物理】後衛で高威力の弓技を放つ夏のカリスマモデル。\nバトル中に放つ「サマーランウェイ♪」でＴＰを全回復\nして、発動後のユニオンバーストがクリティカルになる。", "2024/06/21 12:00:00", 0, "2024/06/26 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 5, 110101, 450, "いお", 715, 110101, 15, 110101, 110101, 1, "イオ（サマー）", 0, 5, 0, 0, 2, 2.4, "【魔法】後衛で、敵の体力を奪い取る、夏の夜の先生。\nダメージを与えつつ味方を回復するスキルを複数持ち、\n攻守どちらの側でも高い能力を発揮する。", "2021/05/18 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 7, 0, 0, "みさき", 0, 110201, 15, 0, 110201, 0, "ミサキ（サマー）", 0, 7, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 110301, 450, "されん", 585, 110301, 3, 110301, 110301, 1, "サレン（サマー）", 0, 4, 0, 0, 1, 2.24, "【物理】中衛で、味方の速攻を支える海辺のサレンママ。\nバトル開始時に味方全体のＴＰを一気に溜めることで、\n迅速にユニオンバーストを発動させることを可能にする。", "2024/06/21 12:00:00", 0, "2024/06/26 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 110401, 450, "まこと", 180, 110401, 4, 110401, 110401, 1, "マコト（サマー）", 0, 5, 0, 0, 1, 2.125, "【物理】前衛で攻撃対象が１つの敵に特化した海の狼娘。\n攻撃対象が１つの場合、スキルとユニオンバーストともに\n真価を発揮し他を圧倒する絶大な破壊力で敵をなぎ払う。", "2024/07/23 12:00:00", 0, "2024/07/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 110501, 450, "かおり", 425, 110501, 4, 110501, 110501, 1, "カオリ（サマー）", 0, 1, 0, 0, 1, 2.42, "【物理】中衛で、敵をまとめてなぎ倒す、真夏の南国娘。\n吹き飛ばし効果を持つスキルで敵をまとめ、攻撃対象が\n多い程、威力が増すユニオンバーストで敵をなぎ倒す。", "2021/06/18 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 110601, 450, "まほ", 792, 110601, 4, 110601, 110601, 1, "マホ（サマー）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で、膨大な魔力を振るう、真夏のおとぎ姫。\n高火力で対象がランダムなスキルやユニオンバーストは、\n攻撃対象が１つの敵に対して絶大なダメージを叩き出す。", "2024/07/23 12:00:00", 0, "2024/07/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 8, 110701, 450, "あおい", 680, 110701, 4, 110701, 110701, 0, "アオイ（編入生）", 0, 8, 0, 0, 1, 1.82, "【物理】後衛で毒を操る、ぼっちエルフの編入生。\n敵が毒や猛毒になっていると強化される攻撃スキルと、\n敵の物理防御力を下げるスキルで味方をサポートする。", "2019/09/03 21:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 2, 110801, 450, "くろえ", 185, 110801, 2, 110801, 110801, 0, "クロエ", 0, 2, 0, 0, 1, 2.125, "【物理】前衛で、手数で圧倒する、ダウナー系エルフ。\n攻撃するたびに相手に【畏縮】ステータスを追加し、\nスキルのダメージと物理防御力ダウンに磨きをかける。", "2019/09/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 110901, 450, "ちえる", 222, 110901, 2, 110901, 110901, 0, "チエル", 0, 1, 0, 0, 1, 2.295, "【物理】前衛でパンチを放つちぇる盛りＭＡＸな女の子。\nクリティカルを出すたびに【ちぇる】を溜め、自己を強化\nし続け、後半になるほど敵をちぇるっとじぇのさいする。", "2020/04/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 26, 111001, 450, "ゆに", 807, 111001, 2, 111001, 111001, 0, "ユニ", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で、味方の支援に特化した象牙の塔の才媛。\n自身の攻撃力は低いが、物理攻撃力の高い味方を強化し\n更に味方全体を魔法無効バリアで護りつつ勝利へ導く。", "2020/03/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 111101, 450, "きょうか", 820, 111101, 13, 111101, 111101, 1, "キョウカ（ハロウィン）", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛で味方の火力を高める、黒猫仮装の優等生。\n自分の魔法攻撃力に応じて効果が強化されるものと、\n効果が累積するもの等、多彩なスキルで攻撃力を高める。", "2024/10/24 12:00:00", 0, "2024/10/28 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 111201, 450, "みそぎ", 212, 111201, 13, 111201, 111201, 1, "ミソギ（ハロウィン）", 0, 1, 0, 0, 1, 2.17, "【物理】前衛で範囲攻撃を放つ、カボチャ衣装の悪戯娘。敵に５カウントで爆発する爆弾を仕掛けたり、カボチャの手榴弾を投げつけたりと、様々な範囲攻撃で敵を弄ぶ。", "2021/08/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 111301, 450, "みみ", 365, 111301, 13, 111301, 111301, 0, "ミミ（ハロウィン）", 0, 5, 0, 0, 1, 2.0, "【物理】中衛の、攻撃に特化した、ぐるぐるうさぎっこ。\n行動頻度は少ないが、高威力の範囲攻撃を放ち、\n味方全体の物理攻撃力を大きく高めるスキルも効果抜群。", "2019/10/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 25, 111401, 450, "るな", 765, 111401, 0, 111401, 111401, 0, "ルナ", 0, 7, 0, 0, 2, 1.87, "【魔法】後衛で、死霊術でおともだちを作る可憐な少女。\nルナがダメージを与える度に集まってくるおともだちを、\n各スキルで消費する。消費数に応じ強大な力を発揮する。", "2019/10/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 10, 111501, 450, "くりすてぃーな", 265, 111501, 13, 111501, 111501, 1, "クリスティーナ（クリスマス）", 0, 4, 0, 0, 1, 2.0, "【物理】前衛で戦いを愉しむ、聖夜の『誓約女君』。\nユニオンバーストを使用すると得られるコインの有無で、\n補助と攻撃の二役を切り替え、華麗に敵を斬り倒す。", "2024/12/22 12:00:00", 0, "2024/12/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 4, 111601, 450, "のぞみ", 418, 111601, 13, 111601, 111601, 1, "ノゾミ（クリスマス）", 0, 4, 0, 0, 1, 2.24, "【物理】中衛でパーティの守りを支えるサンタアイドル。\nスキルで物理攻撃を無効化し、後方の味方が多いほど\n物理防御力を高めるユニオンバーストで生存力を高める。", "2021/10/19 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 111701, 450, "いりや", 255, 111701, 13, 111701, 111701, 0, "イリヤ（クリスマス）", 0, 3, 0, 0, 2, 1.3, "【魔法】前衛で、血を対価に敵を攻撃する聖夜の吸血鬼。\n残りＨＰが低い程ダメージが上昇するスキルと、ＨＰを\n消費するスキルを組み合わせ、絶大な破壊力を発揮する。", "2019/12/20 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 22, 111801, 450, "ぺこりーぬ", 248, 111801, 13, 111801, 111801, 1, "ペコリーヌ（ニューイヤー）", 0, 4, 0, 0, 1, 1.965, "【物理】前衛で元気いっぱいに新年を祝う腹ペコお姫様。\n物理攻撃力を高めるスキルで味方を強化し、ＨＰが多い\nほどダメージが上昇するユニオンバーストで敵を討つ。", "2024/01/26 12:00:00", 0, "2024/01/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 23, 111901, 450, "こっころ", 159, 111901, 1, 111901, 111901, 1, "コッコロ（ニューイヤー）", 0, 7, 0, 0, 1, 1.87, "【物理】前衛で、味方の補助に秀でた、新風の巫女。\n物理クリティカル時のダメージアップのスキルで味方の\n殲滅力を高めつつ、挑発や継続回復で耐久面を支える。", "2024/03/11 12:00:00", 0, "2024/03/18 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 112001, 450, "きゃる", 690, 112001, 3, 112001, 112001, 1, "キャル（ニューイヤー）", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛で、攻防双方で活躍する晴れ着姿の猫娘。\n与ダメージに応じて魔法攻撃力がアップするユニオン\nバーストで、高いベースの攻撃力がさらに強大になる。", "2024/03/11 12:00:00", 0, "2024/03/18 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 21, 112101, 450, "すずめ", 722, 112101, 1, 112101, 112101, 1, "スズメ（ニューイヤー）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で祈りによるサポートを行うドジっ娘巫女。\nスキルの魔法無効バリアで耐久力を高め、ユニオン\nバーストでＨＰ回復と行動速度アップで戦況を整える。", "2021/11/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 112201, 450, "かすみ", 730, 112201, 9, 112201, 112201, 0, "カスミ（マジカル）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛の、妨害に特化した能力を持つ魔法探偵。\n相手のＴＰを大きく減少させるスキルや、遠くの敵を\n束縛するスキルを操り、相手の連携を大きく乱す。", "2020/01/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 8, 112301, 450, "しおり", 712, 112301, 5, 112301, 112301, 1, "シオリ（マジカル）", 0, 8, 0, 0, 1, 1.97, "【物理】後衛で味方の火力の底上げを担う魔法狩人。\nユニオンバーストで味方全体の物理攻撃力を大きく高め\nスキルは範囲内の物理攻撃力を高め、輝矢の一撃を放つ。", "2021/12/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 112401, 450, "うづき", 370, 112401, 18, 112401, 112401, 1, "ウヅキ（デレマス）", 0, 4, 0, 0, 1, 2.24, "【物理】中衛で、味方を鼓舞して戦う、キュートな少女。\n味方をＴＰや攻撃力をアップさせるスキルでサポートし、\n自身も強力な範囲攻撃で敵をなぎ払う。", "2021/03/08 12:00:00", 0, "2021/03/24 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 112501, 450, "りんでれます", 153, 112501, 18, 112501, 112501, 1, "リン（デレマス）", 0, 4, 0, 0, 1, 2.215, "【物理】前衛で、氷を創出し味方を護る、クールな少女。\n目の前の敵を束縛するスキルや挑発で行動を妨害し、\n自身にもバリアを展開し、鉄壁の防御能力を発揮する。", "2021/03/08 12:00:00", 0, "2021/03/24 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 1, 7, 112601, 450, "みお", 695, 112601, 18, 112601, 112601, 1, "ミオ（デレマス）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で攻防共に活躍するパッション溢れる少女。\nダメージを受けた味方中心に回復魔法で補助をし、\nさらに魔法攻撃を仕掛けて、敵を一網打尽にする。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 6, 112701, 450, "りん", 422, 112701, 3, 112701, 112701, 0, "リン（レンジャー）", 0, 6, 0, 0, 1, 2.19, "【物理】中衛から、敵の守りを貫くドングリレンジャー。\n戦闘開始と共に範囲内の敵の物理防御力を大幅に下げ、\n序盤から大ダメージを与えられる戦況を作り出す。", "2020/04/30 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 6, 112801, 450, "まひる", 390, 112801, 5, 112801, 112801, 0, "マヒル（レンジャー）", 0, 6, 0, 0, 1, 2.19, "【物理】中衛で、多勢相手が十八番のまきばの戦士。\n相手を吹き飛ばすスキルを多用し敵の陣形を押し込む。\n範囲攻撃と混乱付与スキルを駆使し一気に殲滅する。", "2020/05/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 8, 112901, 450, "りの", 730, 112901, 6, 112901, 112901, 0, "リノ（ワンダー）", 0, 8, 0, 0, 1, 1.97, "【物理】後衛で、希望の力で戦う、不思議の国の救世主。\nクリティカルすると効果アップのスキルや味方の数が多い\n程、威力がアップするユニオンバーストで敵を殲滅する。", "2020/06/03 19:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 6, 113001, 450, "あゆみ", 508, 113001, 12, 113001, 113001, 1, "アユミ（ワンダー）", 0, 6, 0, 0, 1, 2.34, "【物理】中衛で、戦場の動向を自在に操る白兎の乙女。\n敵の行動速度をダウンさせ、味方の速度をアップさせる\nスキルと敵の時を止めるスキルで、常に味方を支える。", "2020/05/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 27, 113101, 450, "るか", 192, 113101, 6, 113101, 113101, 1, "ルカ（サマー）", 0, 27, 0, 0, 1, 1.3, "【物理】前衛で、流麗な太刀捌きを魅せる若夏の姉御。\nダメージを与えた回数に応じて攻撃力が高まるスキルと、\n携えた二刀の幾刃もの斬撃で、眼前の敵を薙ぎ払う。", "2024/07/23 12:00:00", 0, "2024/07/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 28, 113201, 450, "あんな", 256, 113201, 12, 113201, 113201, 1, "アンナ（サマー）", 0, 5, 0, 0, 2, 1.625, "【魔法】前衛で皆の力を借り受け力を振るう真夏の冥姫。\n味方全体の魔法攻撃力を代償に自身の魔法攻撃力を劇的に\n高め、熾烈な攻撃魔法を繰り出し大ダメージを与える。", "2022/04/18 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 113301, 450, "ななか", 468, 113301, 12, 113301, 113301, 0, "ナナカ（サマー）", 0, 7, 0, 0, 2, 2.07, "【魔法】中衛の多勢相手の戦いが得意な真夏の魔法少女。\n敵の数に応じて効果が上昇する防御力ダウンのスキルや、\n多彩な範囲攻撃を操り、真夏の戦いをサイカワに制する。", "2020/07/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 29, 113401, 450, "はつね", 567, 113401, 12, 113401, 113401, 1, "ハツネ（サマー）", 0, 7, 0, 0, 2, 1.92, "【魔法】中衛から全体魔法攻撃を放つ超能力チアガール。\nユニオンバーストで敵全体に絶大な一撃を放ち、\nその後、超能力発動の反動で枕を抱えて夢の中へ。", "2024/07/23 12:00:00", 0, "2024/07/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 7, 113501, 450, "みさと", 697, 113501, 12, 113501, 113501, 1, "ミサト（サマー）", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛で、敵の脅威から生徒を守る夏女神な先生。\n味方の魔法防御力を高め、ＨＰを継続回復するスキルや、\nバリア展開のユニオンバーストで味方を堅固に守護する。", "2022/05/18 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 113601, 450, "じゅん", 182, 113601, 12, 113601, 113601, 0, "ジュン（サマー）", 0, 5, 0, 0, 1, 2.0, "【物理】前衛で、業火を従え悪を討つ真夏の騎士団長。\n敵単体にダメージを与えつつ、攻撃力を高めるユニオン\nバーストや、火傷を与えるスキルを操り敵を焼き尽くす。", "2020/08/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 113701, 450, "あかり", 530, 113701, 12, 113701, 113701, 0, "アカリ（エンジェル）", 0, 7, 0, 0, 2, 1.92, "【魔法】中衛で、魔法攻撃をお見舞いする双子の妹天使。\n効果時間が短い分、絶大な効果の強化魔法で自身の攻撃力\nを大きく高め、威力抜群の単体魔法で敵を一掃する。", "2020/09/03 19:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 6, 113801, 450, "より", 531, 113801, 12, 113801, 113801, 0, "ヨリ（エンジェル）", 0, 6, 0, 0, 2, 2.34, "【魔法】中衛で、補助魔法で味方を助ける双子の姉天使。\n防御力を大幅に高めつつ、対象の味方に敵の注意を引か\nせるなど、特殊で強力なスキルを駆使し敵を翻弄する。", "2020/09/19 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 2, 113901, 450, "つむぎ", 152, 113901, 12, 113901, 113901, 1, "ツムギ（ハロウィン）", 0, 2, 0, 0, 1, 2.375, "【物理】前衛で敵の物理攻撃を妨害する吸血鬼テーラー。\n挑発と物理無効バリア、さらに最も物理攻撃力が高い敵を\n狙った妨害スキルによって、鉄壁の防御を織り上げる。", "2024/10/24 12:00:00", 0, "2024/10/28 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 114001, 450, "れい", 375, 114001, 12, 114001, 114001, 0, "レイ（ハロウィン）", 0, 4, 0, 0, 1, 1.965, "【物理】中衛で、手負いの敵を死に誘う、幽雅の剣士。\nＨＰが50％未満の敵に対し放つと、威力が大アップする\n範囲攻撃を繰り出し負傷した敵の戦意を一気に叩き折る。", "2020/10/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 114101, 450, "まつり", 186, 114101, 12, 114101, 114101, 1, "マツリ（ハロウィン）", 0, 1, 0, 0, 1, 2.295, "【物理】前衛で鋭爪を突き立てるハロウィン騎士見習い。\nユニオンバーストの使用回数に応じて強化されるスキルで\n与えるダメージと行動速度をアップさせ、敵を斬り裂く。", "2022/07/19 8:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 114201, 450, "もにか", 528, 114201, 12, 114201, 114201, 0, "モニカ（マジカル）", 0, 4, 0, 0, 1, 2.24, "【物理】中衛で愛と希望の力を胸に指揮を執る魔法提督。\nユニオンバーストで敵単体の物理防御力を下げ、範囲内の\n味方の物理攻撃力アップスキルで、一気に戦況を決める。", "2020/10/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 114301, 450, "とも", 402, 114301, 2, 114301, 114301, 0, "トモ（マジカル）", 0, 4, 0, 0, 1, 2.0, "【物理】中衛で正義の力を魔法にのせて戦う魔法剣士。\n自身の物理攻撃力を魔法攻撃力に加える魔法少女の力と、\nたゆまぬ努力で獲得した剣技で、華麗な魔法攻撃を放つ。", "2020/11/21 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 114401, 450, "あきの", 189, 114401, 2, 114401, 114401, 1, "アキノ（クリスマス）", 0, 5, 0, 0, 1, 2.0, "【物理】前衛で味方のサポートを力に戦う、聖夜の令嬢。\nステータスアップ効果を受けると増加する【聖夜の煌き】\nでスキルを大きく強化し、聖夜を彩る強烈な一撃を放つ。", "2024/12/22 12:00:00", 0, "2024/12/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 114501, 450, "されん", 150, 114501, 3, 114501, 114501, 0, "サレン（クリスマス）", 0, 4, 0, 0, 1, 2.09, "【物理】前衛で、光を操り味方を守る聖夜のサレンママ。\n敵の攻撃を防ぎ、ダメージを与えるユニオンバーストや、\nダメージを与えつつ回復するスキルで、攻守双方を担う。", "2020/12/21 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 5, 114601, 450, "ゆかり", 408, 114601, 2, 114601, 114601, 1, "ユカリ（クリスマス）", 0, 5, 0, 0, 1, 2.09, "【物理】中衛で物理キャラを支援し戦う聖夜の元聖騎士。\n魔法攻撃力の高い敵単体のＴＰ減少や周囲の味方の魔法\n防御力アップスキルで、対魔法戦で無類の輝きを放つ。", "2022/09/17 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 31, 114701, 450, "むいみ", 138, 114701, 2, 114701, 114701, 1, "ムイミ（ニューイヤー）", 0, 2, 0, 0, 1, 2.0, "【物理】前衛で、新風纏う「天楼覇断剣」を振るう少女。\n皆より一足遅れて突撃し、敵の前衛を吹き飛ばした後、\n強化した範囲物理攻撃で、ダンゴになった敵を斬り払う。", "2022/10/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 115001, 450, "ねねか", 562, 115001, 2, 115001, 115001, 1, "ネネカ（ニューイヤー）", 0, 7, 0, 0, 2, 2.07, "【魔法】中衛で艶やかな晴れ着を身に纏う『変貌大妃』。\n味方の魔法攻撃力アップやＨＰ、ＴＰを回復させるスキル\nで攻守にわたってサポートし苛烈な戦況でも勝利に導く。", "2024/01/26 12:00:00", 0, "2024/01/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 2, 115501, 450, "こっころ", 533, 115501, 1, 115501, 115501, 1, "コッコロ（儀装束）", 0, 2, 0, 0, 1, 2.0, "【物理】中衛で、尊き儀装束を纏うエルフの里の巫女。\n自分の攻撃力を強化し、さらにＴＰ回復で攻撃の手数を\n増やす。クリティカル時の猛攻で仲間を守る剣となる。", "2024/01/22 12:00:00", 0, "2024/01/26 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 7, 115601, 450, "ゆい", 578, 115601, 7, 115601, 115601, 1, "ユイ（儀装束）", 0, 7, 0, 0, 2, 1.97, "【魔法】中衛で精霊術を操り味方を支える儀装の魔法士。\n複数の物理攻撃力の強化スキルで味方を攻撃支援しつつ\n強力な回復スキルで、前線を整えバトルを掌握する。", "2022/11/17 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 115701, 450, "かすみ", 738, 115701, 9, 115701, 115701, 0, "カスミ（サマー）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で、敵の防御力を削ぎ取る渚の名探偵。\n攻撃力が高い敵に目標を定めて防御力を下げつつ、\n味方を強化するスキルで、どんな難事件も解決へと導く。", "2021/02/23 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 116101, 1, 4, 115801, 450, "りま", 173, 115801, 5, 115801, 115801, 1, "リマ（シンデレラ）", 0, 4, 0, 0, 1, 2.27, "【物理】前衛の魔法の果実でお姫様姿になった恋乙女。\n獣の姿からユニオンバーストで一定時間、人の姿に変身し\n味方全体の攻撃力アップスキルで、火力の底上げをする。", "2022/12/19 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 115901, 450, "まこと", 166, 115901, 4, 115901, 115901, 0, "マコト（シンデレラ）", 0, 5, 0, 0, 1, 2.27, "【物理】前衛で、華装に身を包み流麗な剣舞を舞う狼娘。\n周囲の味方の数に応じて、スキルの威力と物理攻撃力\nアップのスキル効果が上がり、鼓舞激励の一斬を振るう。", "2021/03/03 19:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 116001, 450, "まほ", 645, 116001, 9, 116001, 116001, 0, "マホ（シンデレラ）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛から、優雅に味方を支援するマホ先生。\n物理攻撃をする味方の攻撃力アップや、最遠の味方のＴＰ\nを回復するスキルで、しゃなりしゃなりと戦況を変える。", "2021/03/22 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 2, 116201, 450, "くろえ", 184, 116201, 2, 116201, 116201, 0, "クロエ（聖学祭）", 0, 2, 0, 0, 1, 2.125, "【物理】前衛で疾風の如く駆け抜ける、ダウナー女子。\n特定回数ダメージを与えるたびＴＰを全回復するスキルと\n発動ごとに攻撃力アップのスキルで勝利のテープを掴む。", "2021/04/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 32, 116301, 450, "ちえる", 223, 116301, 2, 116301, 116301, 0, "チエル（聖学祭）", 0, 1, 0, 0, 1, 2.295, "【物理】前衛で聖学祭を盛りアゲる、はぴちぇる系女子。\n攻撃ヒットのたびに【ちぇる】を貯め、威力が増すスキル\nと味方全体の物理攻撃力アップ効果のＵＢで勝利に導く。", "2021/03/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 39, 116401, 450, "ゆに", 808, 116401, 2, 116401, 116401, 0, "ユニ（聖学祭）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛から、仲間を啓蒙するユニちゃんズの才媛。\n自分以外の味方全員の物理・魔法両方の攻撃力アップと\nクリティカル時のダメージアップで皆を勝利へと導く。", "2022/02/08 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 116501, 450, "いのり", 252, 116501, 17, 116501, 116501, 0, "イノリ（タイムトラベル）", 0, 3, 0, 0, 1, 2.295, "【物理】前衛で威勢よく、まくしたてる口撃系ドラゴン。\n全体物理攻撃力アップのＵＢは、味方の防御力を下げる\n代わりにＨＰが多いほど効果を高め、味方を勝利に導く。", "2021/04/30 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 116601, 450, "かや", 169, 116601, 17, 116601, 116601, 0, "カヤ（タイムトラベル）", 0, 1, 0, 0, 1, 2.295, "【物理】前衛で味方を勝利にナビする喧嘩屋ドラゴン族。\nユニオンバーストで自身の攻撃速度を極大アップさせ、\n物理攻撃力アップスキルのシナジーで拳の雨を降らせる。", "2021/05/21 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 33, 116701, 450, "あおい", 527, 116701, 9, 116701, 116701, 0, "アオイ（作業服）", 0, 33, 0, 0, 1, 1.82, "【物理】中衛で敵を妨害する、作業服姿のぼっちエルフ。\n友情の絆で結ばれた『マイフレンドくん』と放つＵＢは、\n敵の動きを阻み、物理防御力を劇的に下げる。", "2021/05/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 2, 116801, 450, "たまき", 216, 116801, 8, 116801, 116801, 1, "タマキ（作業服）", 0, 2, 0, 0, 1, 2.295, "【物理】前衛でたい焼き器片手に悪を討つ売り子の猫娘。\n味方全体を物理攻撃力アップとＴＰ回復させ、ＵＢでさら\nに自分の攻撃力を特大強化し、驚異の威力を発揮する。", "2023/03/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 6, 116901, 450, "みふゆ", 275, 116901, 8, 116901, 116901, 0, "ミフユ（作業服）", 0, 6, 0, 0, 1, 2.065, "【物理】前衛で、皆の盾となり進攻するバイトリーダー。\nバトル序盤は物理の攻防両方をスキルで強化。ＵＢ発動毎\nに自分のクリティカルをアップし猛烈な攻撃を繰り出す。", "2021/06/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 117001, 450, "えりこ", 407, 117001, 11, 117001, 117001, 1, "エリコ（サマー）", 0, 3, 0, 0, 1, 1.55, "【物理】中衛で、火花を纏い夕闇を彩る真夏の壊し屋。\n二つのスキルで物理防御力を下げ、ダメージ量に応じて\nクリティカル上昇が延長するＵＢで眼前の敵を粉砕する。", "2024/08/26 19:00:00", 0, "2024/08/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 117101, 450, "しずる", 163, 117101, 6, 117101, 117101, 0, "シズル（サマー）", 0, 5, 0, 0, 1, 2.0, "【物理】前衛で、堅牢に仲間を守る海辺のお姉ちゃん。\n物理防御力が高い程、効果が高まる複数のスキルを巧みに\n操り防御と補助役をしつつ範囲攻撃で攻撃役をもこなす。", "2021/07/15 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 117201, 450, "のぞみ", 417, 117201, 10, 117201, 117201, 1, "ノゾミ（サマー）", 0, 4, 0, 0, 1, 2.09, "【物理】中衛でみんなを応援する真夏のトップアイドル。\nすべてのスキルで味方全体の物理攻撃をサポートし、\nバトル中盤から味方全体のＴＰ回復で、皆を勝利に導く。", "2024/08/26 19:00:00", 0, "2024/08/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 117301, 450, "ちか", 520, 117301, 10, 117301, 117301, 0, "チカ（サマー）", 0, 7, 0, 0, 2, 2.07, "【魔法】中衛で、守護の賛歌を捧げる夏海の歌姫。\n最序盤に味方の魔法防御を大幅に強化し、吸収バリアや\nＨＰ回復スキルで、如何なる猛攻からも味方を守る。", "2021/08/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 117401, 450, "つむぎ", 355, 117401, 10, 117401, 117401, 1, "ツムギ（サマー）", 0, 1, 0, 0, 1, 2.42, "【物理】中衛で敵を引き寄せ陣形を崩す夕凪のテーラー。\n最も攻撃力の高い敵を、敵陣から自陣に引き寄せつつ\n束縛や行動速度ダウンを絡めたスキルで敵の自由を縛る。", "2023/05/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 117501, 450, "みつき", 552, 117501, 11, 117501, 117501, 0, "ミツキ（オーエド）", 0, 5, 0, 0, 1, 2.4, "【物理】中衛で、戦況のすべてを見据える隻眼の闇医者。\nＨＰが低い敵を束縛し防御力ダウンスキルで仕掛けつつ\n呪詛の毎秒増加する継続ダメージで敵の命を刻々と蝕む。", "2021/09/03 19:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 117601, 450, "ゆき", 798, 117601, 12, 117601, 117601, 0, "ユキ（オーエド）", 0, 7, 0, 0, 2, 2.0, "【魔法】後衛で、迷える皆を救う白衣を纏いし美の象徴。\n一番低い味方１キャラのＴＰを回復し、ＨＰ回復スキルで\n守り、魔法攻撃力アップのスキルで一気に攻め落とす。", "2021/09/13 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 117701, 450, "かおり", 156, 117701, 4, 117701, 117701, 1, "カオリ（ハロウィン）", 0, 1, 0, 0, 1, 2.17, "【物理】前衛の敵を追い詰める程、力を増す幽玄南国娘。\n敵の体力が少ない程、効果が高まる攻撃力アップスキルと\nダメージ量アップの攻撃スキルで、敵を逃さず仕留める。", "2024/10/24 12:00:00", 0, "2024/10/28 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 36, 117801, 450, "にのん", 518, 117801, 12, 117801, 117801, 1, "ニノン（ハロウィン）", 0, 36, 0, 0, 1, 2.25, "【物理】中衛で物理攻撃タイプの味方を強化するシノビ。\n味方の物理攻撃力アップや行動速度アップのスキル効果で\n味方全体の攻撃力を底上げし、勝利の笛を吹きならす。", "2023/07/18 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 8, 117901, 450, "すずな", 761, 117901, 15, 117901, 117901, 0, "スズナ（ハロウィン）", 0, 8, 0, 0, 1, 1.97, "【物理】後衛でアタッカーを狙う小悪魔カリスマモデル。\n誘惑状態だと威力アップの攻撃スキルや、ＴＰを奪い取る\n妨害スキルを放ち、物理攻撃力が最も高い敵を狙い撃つ。", "2021/10/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 35, 118001, 450, "くれじった", 751, 118001, 0, 118001, 118001, 1, "クレジッタ", 0, 35, 0, 0, 1, 1.97, "【物理】後衛で、攻撃と敵の弱体化の二役で輝く女商人。\n生ける金貨が詰まった財布を投げつける不意打ちや、\n金貨の嵐を巻き起こす攻撃で、相手の防御を大きく崩す。", "2024/09/25 12:00:00", 0, "2024/09/30 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 118101, 450, "らんふぁ", 782, 118101, 19, 118101, 118101, 1, "ランファ", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛で、美しい旋律を紡ぎ支援する幽寂の歌姫。\n味方の強化と敵の弱体化の両方面での補助を行い、さらに\n召喚した鉱石の飛竜との波状攻撃により敵を鎮圧する。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 118201, 450, "みそら", 730, 118201, 19, 118201, 118201, 1, "ミソラ", 0, 0, 0, 0, 2, 1.7, "【魔法】後衛で笑顔とともに破壊を振りまく溌溂少女★\n最大３体に着弾するスキルとＵＢは【PSI★チャージ】\n状態で魔防ダウン効果を追加し、邪魔者たちを殲滅する。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "はつね", 732, 118301, 0, 0, 118301, 1, "ハツネ（ハツネ&シオリ）", 0, 0, 0, 180701, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "しおり", 732, 118401, 0, 0, 118401, 1, "シオリ（ハツネ&シオリ）", 0, 0, 0, 180701, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 37, 118501, 450, "かりん", 787, 118501, 0, 118501, 118501, 1, "カリン", 0, 37, 0, 0, 2, 2.0, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", "2021/10/19 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 118601, 450, "ねびあ", 826, 118601, 0, 118601, 118601, 1, "ネビア", 0, 0, 0, 0, 2, 2.0, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", "2024/08/10 21:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 119001, 450, "いお", 714, 119001, 15, 119001, 119001, 0, "イオ（ノワール）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", "2021/11/03 19:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 26, 119101, 450, "くうか", 143, 119101, 12, 119101, 119101, 0, "クウカ（ノワール）", 0, 7, 0, 0, 2, 2.545, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", "2021/11/16 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 6, 119201, 450, "まひる", 397, 119201, 5, 119201, 119201, 1, "マヒル（クリスマス）", 0, 6, 0, 0, 1, 2.19, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", "2023/09/19 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 8, 119301, 450, "りの", 762, 119301, 6, 119301, 119301, 0, "リノ（クリスマス）", 0, 8, 0, 0, 1, 1.97, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", "2021/12/22 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 0, 0, 0, "ぺこりーぬ", 0, 119401, 0, 0, 119401, 0, "ぺコリーヌ", 0, 5, 0, 0, 0, 0.0, "", "2022/01/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 6, 0, 0, "こっころ", 0, 119501, 0, 0, 119501, 0, "コッコロ", 0, 6, 0, 0, 0, 0.0, "", "2022/01/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 7, 0, 0, "きゃる", 0, 119601, 0, 0, 119601, 0, "キャル", 0, 7, 0, 0, 0, 0.0, "", "2022/01/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 0, 0, "しぇふぃ", 0, 119701, 0, 0, 119701, 0, "シェフィ", 0, 4, 0, 0, 0, 0.0, "", "2022/01/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 119901, 450, "みやこ", 302, 119901, 14, 119901, 119901, 1, "ミヤコ（クリスマス）", 0, 1, 0, 0, 1, 2.17, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", "2024/12/22 12:00:00", 0, "2024/12/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 120001, 450, "しずる", 190, 120001, 6, 120001, 120001, 1, "シズル（ノワール）", 0, 5, 0, 0, 1, 2.375, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", "2024/03/22 12:00:00", 0, "2024/03/28 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 0, 0, "いお", 0, 120101, 0, 0, 120101, 0, "イオ（ノワール）", 0, 7, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 26, 0, 0, "くうか", 0, 120201, 0, 0, 120201, 0, "クウカ（ノワール）", 0, 7, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 0, 0, "しずる", 0, 120301, 0, 0, 120301, 0, "シズル（ノワール）", 0, 5, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "みみ", 465, 120401, 0, 0, 120401, 1, "ミミ（リトルリリカル）", 0, 0, 0, 180801, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "みそぎ", 465, 120501, 0, 0, 120501, 1, "ミソギ（リトルリリカル）", 0, 0, 0, 180801, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "きょうか", 465, 120601, 0, 0, 120601, 1, "キョウカ（リトルリリカル）", 0, 0, 0, 180801, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 22, 120701, 450, "しぇふぃ", 283, 120701, 1, 120701, 120701, 1, "シェフィ（ニューイヤー）", 0, 4, 0, 0, 1, 1.84, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", "2024/01/26 12:00:00", 0, "2024/01/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 22, 120801, 450, "るか", 193, 120801, 2, 120801, 120801, 1, "ルカ（ニューイヤー）", 0, 4, 0, 0, 1, 1.3, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", "2023/10/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 38, 120901, 450, "いりや", 424, 120901, 12, 120901, 120901, 1, "イリヤ（ニューイヤー）", 0, 3, 0, 0, 2, 1.425, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", "2024/01/26 12:00:00", 0, "2024/01/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 41, 121001, 450, "ぺこりーぬ", 164, 121001, 1, 121001, 121001, 1, "ペコリーヌ（オーバーロード）", 0, 5, 0, 0, 1, 2.25, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", "2024/02/22 12:00:00", 0, "2024/02/29 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 42, 121101, 450, "きゃる", 588, 121101, 1, 121101, 121101, 1, "キャル（オーバーロード）", 0, 7, 0, 0, 2, 2.07, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", "2024/02/22 12:00:00", 0, "2024/02/29 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 40, 121201, 450, "らびりすた", 260, 121201, 6, 121201, 121201, 1, "ラビリスタ（オーバーロード）", 0, 4, 0, 0, 1, 1.55, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", "2023/11/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 121301, 450, "くるみ", 731, 121301, 3, 121301, 121301, 0, "クルミ（ステージ）", 0, 3, 0, 0, 1, 1.9, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", "2022/03/03 19:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 121401, 450, "みさき", 742, 121401, 15, 121401, 121401, 0, "ミサキ（ステージ）", 0, 7, 0, 0, 2, 2.27, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", "2022/03/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 6, 121501, 450, "あゆみ", 590, 121501, 12, 121501, 121501, 1, "アユミ（怪盗）", 0, 6, 0, 0, 1, 2.0, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", "2024/04/12 12:00:00", 0, "2024/04/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 121601, 450, "いのり", 292, 121601, 17, 121601, 121601, 0, "イノリ（怪盗）", 0, 3, 0, 0, 1, 1.425, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", "2022/04/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "あきの", 421, 121701, 0, 0, 121701, 1, "アキノ（アキノ＆サレン）", 0, 0, 0, 180901, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "されん", 421, 121801, 0, 0, 121801, 1, "サレン（アキノ＆サレン）", 0, 0, 0, 180901, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 121901, 450, "あんな", 293, 121901, 12, 121901, 121901, 0, "アンナ（パイレーツ）", 0, 5, 0, 0, 2, 2.125, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", "2022/05/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 122001, 450, "しのぶ", 380, 122001, 14, 122001, 122001, 0, "シノブ（パイレーツ）", 0, 3, 0, 0, 1, 1.425, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", "2022/05/03 19:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 35, 122101, 450, "あおい", 731, 122101, 9, 122101, 122101, 1, "アオイ（キャンプ）", 0, 35, 0, 0, 1, 1.97, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", "2024/04/18 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 122201, 450, "ゆかり", 419, 122201, 8, 122201, 122201, 0, "ユカリ（キャンプ）", 0, 4, 0, 0, 1, 1.84, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", "2022/05/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 43, 122301, 450, "うぁんぴぃ", 564, 122301, 0, 122301, 122301, 0, "ヴァンピィ", 0, 43, 0, 0, 2, 1.425, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", "2022/06/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 122401, 450, "ひより", 264, 122401, 8, 122401, 122401, 1, "ヒヨリ（サマー）", 0, 1, 0, 0, 1, 2.42, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", "2024/06/17 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 122501, 450, "れい", 250, 122501, 0, 122501, 122501, 1, "レイ（サマー）", 0, 4, 0, 0, 1, 1.965, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", "2024/08/26 19:00:00", 0, "2024/08/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 122601, 450, "ゆい", 554, 122601, 0, 122601, 122601, 0, "ユイ（サマー）", 0, 7, 0, 0, 2, 2.27, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", "2022/07/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 122701, 450, "きょうか", 812, 122701, 0, 122701, 122701, 0, "キョウカ（サマー）", 0, 7, 0, 0, 2, 1.92, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", "2022/08/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 122801, 450, "みそぎ", 237, 122801, 0, 122801, 122801, 1, "ミソギ（サマー）", 0, 1, 0, 0, 1, 2.295, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", "2024/07/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 122901, 450, "みみ", 361, 122901, 0, 122901, 122901, 1, "ミミ（サマー）", 0, 5, 0, 0, 1, 2.25, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", "2024/08/26 19:00:00", 0, "2024/08/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 44, 123001, 450, "あめす", 746, 123001, 0, 123001, 123001, 1, "アメス", 0, 44, 0, 0, 2, 2.27, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 123101, 450, "まほ", 793, 123101, 0, 123101, 123101, 0, "マホ（エクスプローラー）", 0, 7, 0, 0, 2, 1.795, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", "2022/09/03 19:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 123201, 450, "あやね", 256, 123201, 0, 123201, 123201, 0, "アヤネ（エクスプローラー）", 0, 3, 0, 0, 1, 1.425, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", "2022/09/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 123301, 450, "ねあ", 350, 123301, 0, 123301, 123301, 1, "ネア", 0, 1, 0, 0, 1, 1.62, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", "2024/09/25 12:00:00", 0, "2024/09/30 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 0, 0, "じゅん", 0, 123401, 0, 0, 123401, 0, "ジュン（キャンプ）", 0, 5, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 6, 123501, 450, "りん", 583, 123501, 0, 123501, 123501, 1, "リン（ハロウィン）", 0, 6, 0, 0, 1, 2.34, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", "2024/09/17 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 123601, 450, "とも", 262, 123601, 0, 123601, 123601, 1, "トモ（ハロウィン）", 0, 4, 0, 0, 1, 1.965, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", "2024/10/24 12:00:00", 0, "2024/10/28 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 123701, 450, "ななか", 741, 123701, 0, 123701, 123701, 0, "ナナカ（ハロウィン）", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", "2022/10/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 123801, 450, "くりすてぃーな", 238, 123801, 0, 123801, 123801, 1, "クリスティーナ（ワイルド）", 0, 1, 0, 0, 1, 2.295, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", "2024/11/26 12:00:00", 0, "2024/11/30 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 2, 123901, 450, "まつり", 183, 123901, 0, 123901, 123901, 0, "マツリ（ワイルド）", 0, 2, 0, 0, 1, 2.125, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", "2022/11/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 124001, 450, "あかり", 438, 124001, 0, 124001, 124001, 1, "アカリ（クリスマス）", 0, 7, 0, 0, 2, 2.07, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", "2024/12/22 12:00:00", 0, "2024/12/31 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 6, 124101, 450, "より", 433, 124101, 0, 124101, 124101, 1, "ヨリ（クリスマス）", 0, 6, 0, 0, 2, 1.965, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", "2024/11/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 124201, 450, "じゅん", 144, 124201, 0, 124201, 124201, 0, "ジュン（クリスマス）", 0, 5, 0, 0, 1, 2.07, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", "2022/12/23 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "あん", 577, 124301, 0, 0, 124301, 1, "アン（アン＆グレア）", 0, 0, 0, 181001, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "ぐれあ", 577, 124401, 0, 0, 124401, 1, "グレア（アン＆グレア）", 0, 0, 0, 181001, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 124501, 450, "ほまれ", 707, 124501, 0, 124501, 124501, 1, "ホマレ（ニューイヤー）", 0, 7, 0, 0, 2, 2.07, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", "2024/01/12 12:00:00", 0, "2024/01/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 124601, 450, "みさと", 698, 124601, 0, 124601, 124601, 1, "ミサト（ニューイヤー）", 0, 7, 0, 0, 2, 2.44, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", "2024/01/12 12:00:00", 0, "2024/01/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 46, 124701, 450, "みつき", 590, 124701, 0, 124701, 124701, 1, "ミツキ（ニューイヤー）", 0, 7, 0, 0, 1, 2.24, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", "2024/12/16 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 124801, 450, "のぞみ", 423, 124801, 0, 124801, 124801, 1, "ノゾミ（リベレイター）", 0, 4, 0, 0, 1, 2.14, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", "2024/02/12 12:00:00", 0, "2024/02/14 23:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 1, 0, 124901, 450, "かや", 170, 124901, 0, 124901, 124901, 1, "カヤ（リベレイター）", 0, 1, 0, 0, 1, 1.965, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", "2023/01/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 125001, 450, "むいみ", 221, 125001, 0, 125001, 125001, 1, "ムイミ（リベレイター）", 0, 5, 0, 0, 1, 1.965, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", "2024/02/12 12:00:00", 0, "2024/02/14 23:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 47, 125101, 450, "たまき", 825, 125101, 0, 125101, 125101, 0, "タマキ（カフェ）", 0, 8, 0, 0, 1, 2.24, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", "2023/03/03 19:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 125201, 450, "もにか", 463, 125201, 0, 125201, 125201, 0, "モニカ（カフェ）", 0, 4, 0, 0, 1, 1.965, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", "2023/03/10 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 6, 125301, 450, "こっころ", 752, 125301, 0, 125301, 125301, 1, "コッコロ（レンジャー）", 0, 6, 0, 0, 1, 2.07, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", "2024/04/12 12:00:00", 0, "2024/04/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 8, 125401, 450, "しおり", 710, 125401, 0, 125401, 125401, 0, "シオリ（レンジャー）", 0, 8, 0, 0, 1, 2.09, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", "2023/04/10 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 50, 125501, 450, "じーた", 443, 125501, 0, 125501, 125501, 1, "ジータ（ウォーロック）", 0, 7, 0, 0, 2, 1.92, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", "2024/05/10 12:00:00", 0, "2024/05/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 125601, 450, "びから", 267, 125601, 0, 125601, 125601, 1, "ビカラ", 0, 51, 0, 0, 1, 2.09, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", "2024/05/10 12:00:00", 0, "2024/05/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 1, 9, 125701, 450, "かりん", 579, 125701, 0, 125701, 125701, 1, "カリン（アルケミスト）", 0, 7, 0, 0, 2, 2.24, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", "2023/04/30 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 125801, 450, "りり", 464, 125801, 0, 125801, 125801, 0, "リリ（フォールン）", 0, 3, 0, 0, 1, 2.09, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", "2023/04/17 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 0, 0, "かや", 0, 125901, 0, 0, 125901, 1, "カヤ（リベレイター）", 0, 1, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 126001, 450, "くりあ", 406, 126001, 0, 126001, 126001, 0, "クリア（フォールン）", 0, 0, 0, 0, 1, 2.09, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", "2023/10/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 53, 126101, 450, "ぷれしあ", 480, 126101, 0, 126101, 126101, 0, "プレシア（フォールン）", 0, 44, 0, 0, 2, 2.09, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", "2023/11/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 3, 126201, 450, "いりや", 568, 126201, 0, 126201, 126201, 1, "イリヤ（儀装束）", 0, 3, 0, 0, 2, 2.09, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", "2024/06/10 12:00:00", 0, "2024/06/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 9, 126301, 450, "ゆき", 456, 126301, 0, 126301, 126301, 0, "ユキ（儀装束）", 0, 7, 0, 0, 2, 2.07, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", "2023/06/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 126401, 450, "くろーちぇ", 373, 126401, 0, 126401, 126401, 1, "クローチェ", 0, 1, 0, 0, 1, 2.09, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 126501, 450, "らいらえる", 740, 126501, 0, 126501, 126501, 1, "ライラエル", 0, 7, 0, 0, 2, 1.965, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 126601, 450, "ねねか", 650, 126601, 0, 126601, 126601, 1, "ネネカ（サマー）", 0, 7, 0, 0, 2, 2.04, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", "2024/07/11 12:00:00", 0, "2024/07/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 1, 5, 126701, 450, "あきの", 224, 126701, 0, 126701, 126701, 1, "アキノ（サマー）", 0, 5, 0, 0, 1, 1.965, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", "2023/06/30 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 126801, 450, "ゆかり", 159, 126801, 0, 126801, 126801, 0, "ユカリ（サマー）", 0, 5, 0, 0, 1, 1.97, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", "2023/07/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 126901, 450, "らんふぁ", 682, 126901, 0, 126901, 126901, 1, "ランファ（サマー）", 0, 7, 0, 0, 2, 1.965, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", "2024/08/09 12:00:00", 0, "2024/08/12 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 1, 52, 127001, 450, "くうか", 133, 127001, 0, 127001, 127001, 1, "クウカ（サマー）", 0, 2, 0, 0, 1, 1.97, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", "2023/07/31 12:00:00", 0, "2023/08/14 20:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 46, 127101, 450, "しのぶ", 255, 127101, 0, 127101, 127101, 1, "シノブ（サマー）", 0, 5, 0, 0, 1, 2.09, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", "2024/08/09 12:00:00", 0, "2024/08/12 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 127201, 450, "きゃる", 804, 127201, 0, 127201, 127201, 1, "キャル（編入生）", 0, 7, 0, 0, 2, 2.09, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", "2024/10/10 12:00:00", 0, "2024/10/13 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 8, 127301, 450, "すずな", 750, 127301, 0, 127301, 127301, 0, "スズナ（編入生）", 0, 8, 0, 0, 1, 2.09, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", "2023/09/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 0, 0, "びから", 0, 127401, 0, 0, 127401, 1, "ビカラ（コラボ）", 0, 1, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 127501, 450, "されん", 304, 127501, 0, 127501, 127501, 1, "サレン（サラサリア）", 0, 4, 0, 0, 1, 2.09, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", "2024/11/11 12:00:00", 0, "2024/11/18 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 127601, 450, "るか", 157, 127601, 0, 127601, 127601, 0, "ルカ（サラサリア）", 0, 4, 0, 0, 1, 1.965, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", "2023/10/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 48, 127701, 450, "りんど", 693, 127701, 0, 127701, 127701, 0, "リンド", 0, 6, 0, 0, 2, 1.965, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", "2024/10/10 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 47, 127801, 450, "うるむ", 706, 127801, 0, 127801, 127801, 0, "ヴルム", 0, 7, 0, 0, 2, 1.965, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", "2024/10/18 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 127901, 450, "ぺこりーぬ", 372, 127901, 0, 127901, 127901, 1, "ペコリーヌ（クリスマス）", 0, 5, 0, 0, 2, 1.965, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", "2024/12/09 12:00:00", 0, "2024/12/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 35, 128001, 450, "くれじった", 723, 128001, 0, 128001, 128001, 0, "クレジッタ（クリスマス）", 0, 35, 0, 0, 1, 2.09, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", "2023/12/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "しずる", 580, 128101, 0, 0, 128101, 1, "シズル（シズル&リノ）", 0, 0, 0, 181101, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 0, 0, 0, "りの", 580, 128201, 0, 0, 128201, 1, "リノ（シズル&リノ）", 0, 0, 0, 181101, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 1, 38, 128301, 450, "いのり", 191, 128301, 0, 128301, 128301, 1, "イノリ（ニューイヤー）", 0, 3, 0, 0, 1, 2.09, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", "2023/12/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 128401, 450, "はつね", 801, 128401, 0, 128401, 128401, 1, "ハツネ（ニューイヤー）", 0, 7, 0, 0, 2, 2.09, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", "2025/01/09 12:00:00", 0, "2025/01/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 128501, 450, "かすみ", 739, 128501, 0, 128501, 128501, 1, "カスミ（ニューイヤー）", 0, 7, 0, 0, 2, 2.09, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", "2025/01/09 12:00:00", 0, "2025/01/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 0, 0, "りり", 0, 128601, 0, 0, 128601, 1, "リリ（フォールン）", 0, 1, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 128701, 450, "ひより", 226, 128701, 0, 128701, 128701, 1, "ヒヨリ（アストラル）", 0, 1, 0, 0, 1, 2.09, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", "2024/08/12 12:00:00", 0, "2024/08/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 1, 0, 128801, 450, "れい", 194, 128801, 0, 128801, 128801, 1, "レイ（アストラル）", 0, 4, 0, 0, 1, 1.965, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", "2024/01/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 128901, 450, "ゆい", 772, 128901, 0, 128901, 128901, 1, "ユイ（アストラル）", 0, 7, 0, 0, 2, 2.09, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", "2024/08/12 12:00:00", 0, "2024/08/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 129001, 450, "えりす", 800, 129001, 0, 129001, 129001, 1, "エリス", 0, 7, 0, 0, 2, 2.09, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 129301, 450, "ゆに", 708, 129301, 0, 129301, 129301, 1, "ユニ（ウィンター）", 0, 7, 0, 0, 1, 2.09, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", "2024/09/25 12:00:00", 0, "2024/09/30 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 2, 129401, 450, "くろえ", 188, 129401, 0, 129401, 129401, 0, "クロエ（ウィンター）", 0, 2, 0, 0, 1, 2.09, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", "2024/03/18 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 129501, 450, "ちえる", 247, 129501, 0, 129501, 129501, 1, "チエル（ウィンター）", 0, 1, 0, 0, 1, 2.09, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", "2024/12/15 15:00:00", 0, "2024/12/22 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 129601, 450, "あねもね", 550, 129601, 0, 129601, 129601, 1, "アネモネ", 0, 0, 0, 0, 1, 2.09, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 129701, 450, "ねふぃーねら", 540, 129701, 0, 129701, 129701, 1, "ネフィ＝ネラ", 0, 0, 0, 0, 1, 2.09, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 5, 129801, 450, "まこと", 269, 129801, 0, 129801, 129801, 1, "マコト（コマンダー）", 0, 5, 0, 0, 1, 2.09, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", "2024/10/13 12:00:00", 0, "2024/10/18 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 48, 129901, 450, "えりこ", 294, 129901, 0, 129901, 129901, 0, "エリコ（コマンダー）", 0, 6, 0, 0, 1, 1.84, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", "2024/04/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 130001, 450, "やまと", 150, 130001, 0, 130001, 130001, 1, "ヤマト", 0, 4, 0, 0, 1, 2.09, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", "2024/11/11 12:00:00", 0, "2024/11/18 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 9, 130101, 450, "わかな", 535, 130101, 0, 130101, 130101, 1, "ワカナ", 0, 7, 0, 0, 1, 2.09, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", "2024/11/18 12:00:00", 0, "2024/11/26 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 130201, 450, "ふぶき", 371, 130201, 0, 130201, 130201, 1, "フブキ", 0, 5, 0, 0, 1, 1.84, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", "2024/10/31 12:00:00", 0, "2024/11/11 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 0, 0, "れい", 0, 130601, 0, 0, 130601, 1, "レイ（アストラル）", 0, 4, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 130701, 450, "きょうか", 563, 130701, 0, 130701, 130701, 1, "キョウカ（スプリング）", 0, 7, 0, 0, 2, 1.92, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", "2024/11/11 12:00:00", 0, "2024/11/18 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 130801, 450, "すずめ", 558, 130801, 0, 130801, 130801, 0, "スズメ（スプリング）", 0, 7, 0, 0, 2, 1.84, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", "2024/05/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 130901, 450, "くるる", 440, 130901, 0, 130901, 130901, 0, "クルル", 0, 7, 0, 0, 2, 2.09, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", "2024/06/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 131001, 450, "まほ", 702, 131001, 0, 131001, 131001, 1, "マホ（ドリームパーク）", 0, 7, 0, 0, 2, 1.84, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", "2024/12/09 12:00:00", 0, "2024/12/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 52, 131101, 450, "ねあ", 165, 131101, 0, 131101, 131101, 0, "ネア（サマー）", 0, 2, 0, 0, 1, 2.09, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", "2024/06/30 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 35, 131201, 450, "みそら", 753, 131201, 0, 131201, 131201, 1, "ミソラ（サマー）", 0, 35, 0, 0, 2, 2.09, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", "2025/01/09 12:00:00", 0, "2025/01/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 1, 0, 0, "りり", 0, 131301, 0, 0, 131301, 1, "リリ", 0, 1, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 1, 0, 0, "くりあ", 0, 131401, 0, 0, 131401, 1, "クリア", 0, 1, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 3, 1, 0, 0, "ぷれしあ", 0, 131501, 0, 0, 131501, 1, "プレシア", 0, 1, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 4, 131601, 450, "りり", 399, 131601, 0, 131601, 131601, 1, "リリ（サマー）", 0, 4, 0, 0, 1, 1.92, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", "2025/01/09 12:00:00", 0, "2025/01/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 53, 131701, 450, "あめす", 743, 131701, 0, 131701, 131701, 1, "アメス（サマー）", 0, 44, 0, 0, 2, 1.92, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", "2024/07/31 12:00:00", 0, "2024/08/12 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 131801, 450, "ほまれ", 709, 131801, 0, 131801, 131801, 0, "ホマレ（サマー）", 0, 7, 0, 0, 2, 2.09, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", "2024/08/15 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 1, 23, 131901, 450, "えみりあ", 725, 131901, 0, 131901, 131901, 1, "エミリア（サマー）", 0, 7, 0, 0, 2, 2.09, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", "2024/08/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 21, 132001, 450, "えきどな", 775, 132001, 0, 132001, 132001, 1, "エキドナ（サマー）", 0, 7, 0, 0, 2, 2.09, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", "2024/09/13 12:00:00", 0, "2024/09/25 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 24, 132101, 450, "れむ", 146, 132101, 0, 132101, 132101, 1, "レム（サマー）", 0, 13, 0, 0, 1, 2.09, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", "2024/08/31 12:00:00", 0, "2024/09/13 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 7, 132201, 450, "のぞみ", 721, 132201, 0, 132201, 132201, 1, "ノゾミ（アルケミスト）", 0, 7, 0, 0, 2, 1.84, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", "2024/09/30 12:00:00", 0, "2024/10/10 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 132801, 450, "らいらえる", 750, 132801, 0, 132801, 132801, 1, "ライラエル（クリスマス）", 0, 7, 0, 0, 2, 2.09, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", "2024/11/30 12:00:00", 0, "2024/12/09 11:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 46, 132901, 450, "いお", 748, 132901, 0, 132901, 132901, 0, "イオ（クリスマス）", 0, 5, 0, 0, 2, 2.09, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", "2024/12/09 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 133001, 450, "ぐれいす", 234, 133001, 0, 133001, 133001, 1, "グレイス", 0, 0, 0, 0, 1, 2.09, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (1, 0, 1, 22, 133201, 450, "もにか", 296, 133201, 0, 133201, 133201, 1, "モニカ（ニューイヤー）", 0, 4, 0, 0, 1, 2.09, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", "2024/12/31 12:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 22, 133501, 450, "されん", 718, 133501, 0, 133501, 133501, 1, "サレン（ニューイヤー）", 0, 4, 0, 0, 2, 2.09, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", "2025/01/03 19:00:00", 0, "2025/01/15 14:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 0, 0, "ふぶき", 0, 134101, 0, 0, 134101, 1, "フブキ", 0, 5, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 1, 0, 0, "らいらえる", 0, 134201, 0, 0, 134201, 1, "ライラエル（クリスマス）", 0, 7, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 0, 0, "めどぅーさ", 0, 136601, 0, 0, 136601, 0, "メドゥーサ", 0, 1, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 34, 105701, 450, "じーた", 245, 170101, 4, 170101, 170101, 0, "ジータ", 0, 34, 0, 0, 1, 1.965, "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 180101, 450, "ひより", 199, 180101, 7, 180101, 180101, 1, "ヒヨリ（プリンセス）", 0, 0, 0, 0, 1, 1.62, "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 180201, 450, "ゆい", 767, 180201, 1, 180201, 180201, 1, "ユイ（プリンセス）", 0, 0, 0, 0, 2, 1.92, "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 180301, 450, "れい", 377, 180301, 7, 180301, 180301, 1, "レイ（プリンセス）", 0, 0, 0, 0, 1, 1.965, "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 180401, 450, "ぺこりーぬ", 155, 180401, 1, 180401, 180401, 1, "ペコリーヌ（プリンセス）", 0, 0, 0, 0, 1, 1.965, "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 180501, 450, "こっころ", 555, 180501, 1, 180501, 180501, 1, "コッコロ（プリンセス）", 0, 0, 0, 0, 1, 2.14, "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 180601, 450, "きゃる", 747, 180601, 1, 180601, 180601, 1, "キャル（プリンセス）", 0, 0, 0, 0, 2, 1.92, "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 180701, 450, "はつねしおり", 732, 180701, 1, 180701, 180701, 1, "ハツネ＆シオリ", 0, 0, 0, 0, 1, 1.75, "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 180801, 450, "みそぎみみきょうか", 465, 180801, 1, 180801, 180801, 1, "ミソギ＆ミミ＆キョウカ", 0, 0, 0, 0, 1, 1.5, "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 180901, 450, "あきのされん", 421, 180901, 1, 180901, 180901, 1, "アキノ＆サレン", 0, 0, 0, 0, 1, 2.09, "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 181001, 450, "あんぐれあ", 577, 181001, 1, 181001, 181001, 1, "アン＆グレア", 0, 0, 0, 0, 2, 2.09, "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 181101, 450, "しずるりの", 551, 181101, 1, 181101, 181101, 1, "シズル＆リノ", 0, 0, 0, 0, 1, 1.92, "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 3, 0, 181201, 450, "しぇふぃ", 368, 181201, 1, 181201, 181201, 1, "シェフィ（プリンセス）", 0, 0, 0, 0, 1, 1.92, "【物理】中衛で新たな力と共に再廻する姫装の氷竜少女。\n環境効果【絶氷】でクリティカルダメージを高め、火力と\n手数を併せ持つ剣技で、再び共に歩むため道を切り開く。", "2024/12/31 12:00:00", 0, "2025/01/03 18:59:59");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 0, 0, "かりん", 0, 190801, 0, 0, 190801, 0, "カリン", 0, 1, 0, 0, 1, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 1, 0, 0, "ぺてるぎうす", 0, 191201, 0, 0, 191201, 0, "ペテルギウス", 0, 1, 0, 0, 1, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 1, 6, 191301, 450, "かずまさ", 850, 191301, 0, 191301, 191301, 1, "カズマサ", 0, 6, 0, 0, 1, 2.22, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES (0, 0, 0, 6, 0, 0, "こっころ", 0, 191401, 0, 0, 191401, 0, "コッコロ", 0, 6, 0, 0, 0, 0.0, "", "2015/04/01 15:00:00", 0, "2030/12/31 15:00:00");
